import React, { Component } from 'react';
import Button from '@material-ui/core/Button';

class LeftPanel extends Component {
    render() {
        return (
            <div className="col-md-6">
                <Button variant="contained" color="primary">
                    Hello World
                </Button>
            </div>
        );
    }
}

export default LeftPanel;
